import React, { Component } from "react";
import logo from '../assets/hoaxify.png';
import {Link} from 'react-router-dom';
import { withTranslation } from "react-i18next";
class TopBar extends Component {
  render() {
      const { t } = this.props;
    return (
      <div className="container-fluid shadow rounded   bg-primary mb-2">
        <nav className=" navbar navbar-dark container">
          <Link className="navbar-brand" to="/">
            <img src={logo} width="70" alt="Hoaxify Logo"/>
            Hoaxify
          </Link>
            <ul className="nav navbar-nav">
                <li className="light"><Link className="nav-link" to="/login">{t('Login')}</Link></li>
                <li><Link className="nav-link" to="/signup">{t('Sign Up')}</Link></li>
            </ul>

        </nav>
      </div>
    );
  }
}

export default withTranslation()(TopBar);
